import React from "react";
import { Col, Row } from "react-bootstrap";
import { useSelector } from "react-redux";

export const LojaFiltro = (props) => {
  let { titulo, filtros } = props;

  let filtrosKeys = Object.keys(filtros);
  console.log(filtrosKeys);
  return (
    <Col xs={true}>
      <h5>{titulo}</h5>
      {filtrosKeys.map((filtroKey) => {
        return (
          <Row>
            <Col xs={true} style={{ width: "max-content", maxWidth: "none" }}>
              <input
                type="checkbox"
                id="vehicle1"
                name="vehicle1"
                value="Bike"
              />
              <label for="vehicle1"> {filtroKey}</label> <br />
            </Col>
          </Row>
        );
      })}
    </Col>
  );
};
